import Card from "./components/UI/Card";
import LogsForm from "./components/LogsForm/LogsForm";
import '../src/App.css'
const App = (props) =>{

// -----------------------------------------
const logsData =[
    {
        id: '001',
        date : new Date(2022 ,1,20,18,30),
        desc : 'data xxx1',
        time: 30
    }, 
    {
        id: '002',
        date : new Date(2022 ,6,12,18,30),
        desc : 'data xxx1',
        time: 55
    }, 
    {
        id: '003',
        date : new Date(2022 ,11,3,18,30),
        desc : 'data xxx1',
        time: 66
    }, 
    {
        id: '004',
        date : new Date(2022 ,0,20,18,30),
        desc : 'data xxx1',
        time: 88
    },


]

// -------------------------------------------


    return <div className="app">
         
        <LogsForm/>
        
        <Logs logsData={logsData}/>

        
        </div>
};


export default App;
